        protected override void convertWinsByBet(Dictionary<string, string> dicParams, float currentBet)
        {
            base.convertWinsByBet(dicParams, currentBet);
            if(dicParams.ContainsKey("accv"))
            {
                string[] strParts = dicParams["accv"].Split(new string[] { "~" }, StringSplitOptions.RemoveEmptyEntries);
                for(int i = 0; i < 4; i++)
                    strParts[i] = convertWinByBet(strParts[i], currentBet);

                dicParams["accv"] = string.Join("~", strParts);
            }
            if(dicParams.ContainsKey("g"))
            {
                var gParam = JToken.Parse(dicParams["g"]);
                string[] strKeys = new string[] { "fg_a", "fg_b", "fg_c", "fg_d" };
                for(int i = 0; i < strKeys.Length; i++)
                {
                    if (gParam[strKeys[i]] != null)
                    {
                        int winLineID = 0;
                        do
                        {
                            string strKey = string.Format("l{0}", winLineID);
                            if (gParam[strKeys[i]][strKey] == null)
                                break;

                            string[] strParts = gParam[strKeys[i]][strKey].ToString().Split(new string[] { "~" }, StringSplitOptions.None);
                            if (strParts.Length >= 2)
                            {
                                strParts[1] = convertWinByBet(strParts[1], currentBet);
                                gParam[strKeys[i]][strKey] = string.Join("~", strParts);
                            }
                            winLineID++;
                        } while (true);
                    }
                }
                dicParams["g"] = serializeJsonSpecial(gParam);
            }

            if(dicParams.ContainsKey("fs") || dicParams.ContainsKey("fs_total"))
            {
                int winLineID = 0;
                do
                {
                    string strKey = string.Format("l{0}", winLineID);
                    if (!dicParams.ContainsKey(strKey))
                        break;
                    dicParams.Remove(strKey);
                    winLineID++;
                } while (true);
            }


        }
        protected override void supplementInitResult(Dictionary<string, string> dicParams, BasePPSlotBetInfo betInfo, BasePPSlotSpinResult spinResult)
        {
            base.supplementInitResult(dicParams, betInfo, spinResult);
            if (!dicParams.ContainsKey("reel_set"))
                dicParams["reel_set"] = "0";
            if (!dicParams.ContainsKey("g"))
            {
                dicParams["g"] = "{fg_a:{def_s:\"8,15,13,7,10,7,12,6,15,15,9,11,14,14,14\",def_sa:\"6,11,12,13,6\",def_sb:\"13,15,12,11,7\",reel_set:\"4\",sh:\"3\",st:\"rect\",sw:\"5\"},fg_b:{def_s:\"6,14,9,13,14,7,10,12,13,8,8,13,14,12,12\",def_sa:\"14,8,7,13,13\",def_sb:\"12,11,7,14,15\",reel_set:\"6\",sh:\"3\",st:\"rect\",sw:\"5\"},fg_c:{def_s:\"13,6,9,15,7,15,7,13,8,12,12,8,15,13,14\",def_sa:\"13,14,7,13,10\",def_sb:\"14,11,9,6,11\",reel_set:\"8\",sh:\"3\",st:\"rect\",sw:\"5\"},fg_d:{def_s:\"10,14,11,11,7,7,13,13,13,14,8,15,12,14,13\",def_sa:\"8,11,15,15,9\",def_sb:\"6,14,14,12,15\",reel_set:\"10\",sh:\"3\",st:\"rect\",sw:\"5\"}}";
            }
            else
            {
                var defGParam   = JToken.Parse("{fg_a:{def_s:\"8,15,13,7,10,7,12,6,15,15,9,11,14,14,14\",def_sa:\"6,11,12,13,6\",def_sb:\"13,15,12,11,7\",reel_set:\"4\",sh:\"3\",st:\"rect\",sw:\"5\"},fg_b:{def_s:\"6,14,9,13,14,7,10,12,13,8,8,13,14,12,12\",def_sa:\"14,8,7,13,13\",def_sb:\"12,11,7,14,15\",reel_set:\"6\",sh:\"3\",st:\"rect\",sw:\"5\"},fg_c:{def_s:\"13,6,9,15,7,15,7,13,8,12,12,8,15,13,14\",def_sa:\"13,14,7,13,10\",def_sb:\"14,11,9,6,11\",reel_set:\"8\",sh:\"3\",st:\"rect\",sw:\"5\"},fg_d:{def_s:\"10,14,11,11,7,7,13,13,13,14,8,15,12,14,13\",def_sa:\"8,11,15,15,9\",def_sb:\"6,14,14,12,15\",reel_set:\"10\",sh:\"3\",st:\"rect\",sw:\"5\"}}");
                var gParam      = JToken.Parse(dicParams["g"]);
                string[] strKeys = new string[] { "fg_a", "fg_b", "fg_c", "fg_d" };
                foreach(string strKey in strKeys)
                {
                    if (gParam[strKey] != null && defGParam[strKey] != null)
                    {
                        gParam[strKey]["def_s"]  = defGParam[strKey]["def_s"];
                        gParam[strKey]["def_sa"] = defGParam[strKey]["def_sa"];
                        gParam[strKey]["def_sb"] = defGParam[strKey]["def_sb"];

                        if (gParam[strKey]["reel_set"] == null)
                            gParam[strKey]["reel_set"] = defGParam[strKey]["reel_set"];
                    }
                    else if (gParam[strKey] == null)
                    {
                        gParam[strKey] = defGParam[strKey];
                    }
                }
                dicParams["g"] = serializeJsonSpecial(gParam);
            }
        }
        protected override void readBetInfoFromMessage(GITMessage message, string strUserID)
        {
            try
            {
                ChaseForGloryBetInfo betInfo    = new ChaseForGloryBetInfo();
                betInfo.BetPerLine              = (float)message.Pop();
                betInfo.LineCount               = (int)message.Pop();
		
		
                if (message.DataNum >= 3)
                    betInfo.PurchaseFree = true;
                else
                    betInfo.PurchaseFree = false;
		
                if (betInfo.BetPerLine <= 0.0f)
                {
                    _logger.Error("{0} betInfo.BetPerLine <= 0 in ChaseForGloryGameLogic::readBetInfoFromMessage {1}", strUserID, betInfo.BetPerLine);
                    return;
                }
		
                if (betInfo.LineCount != this.ClientReqLineCount)
                {
                    _logger.Error("{0} betInfo.LineCount is not matched {1}", strUserID, betInfo.LineCount);
                    return;
                }

                BasePPSlotBetInfo oldBetInfo = null;
                if (_dicUserBetInfos.TryGetValue(strUserID, out oldBetInfo))
                {
                    if (oldBetInfo.HasRemainResponse)
                        return;

                    oldBetInfo.BetPerLine   = betInfo.BetPerLine;
                    oldBetInfo.LineCount    = betInfo.LineCount;
                    oldBetInfo.MoreBet      = betInfo.MoreBet;
                    oldBetInfo.PurchaseFree = betInfo.PurchaseFree;
                }
                else
                {
                    _dicUserBetInfos.Add(strUserID, betInfo);
                }
            }
            catch (Exception ex)
            {
                _logger.Error("Exception has been occurred in ChaseForGloryGameLogic::readBetInfoFromMessage {0}", ex);
            }
        }
